    def count_substring(self, s: str, c: str) -> int:
        count = 0
        n = len(s)
        m = len(c)
        dp = [[0] * (m + 1) for _ in range(n + 1)]

        for i in range(1, n + 1):
            for j in range(1, m + 1):
                if c[j - 1] == s[i - 1]:
                    dp[i][j] = dp[i - 1][j - 1] + 1
                else:
                    dp[i][j] = max(dp[i - 1][j], dp[i][j - 1])

            if dp[i][m] >= m:
                count = count + 1

        return count

